INSERT INTO `comment` (`id`, `productid`, `username`, `email`, `comment`, `postedat`, `reaction`) VALUES
(29, 9, 'Khusdil Singh', 'asad.pstu@yahoo.com', 'Falcons are birds of prey in the genus Falco, which includes about 40 species. Falcons are widely distributed on all continents of the world except Antarctica.', '2018-09-24 03:53:43', NULL),
(30, 9, 'Fouzia zahan', 'fouzia.zahan@gmail.com', 'The Late Latin falco is believed to derive from falx as meaning a sickle, referencing the claws of the bird. In Middle English and Old French, the term falcon refers generically to several captive raptor species.', '2018-09-24 03:54:53', NULL),
(31, 9, 'H M Asadzaman', 'fongbet365@gmail.com', 'Falcon, any of nearly 60 species of hawks of the family Falconidae (order Falconiformes), diurnal birds of prey characterized by long, pointed wings and swift, powerful flight. ', '2018-09-24 04:18:46', NULL),
(32, 4, 'Asadzaman', 'hmasad08@gmail.com', 'Powerful and fast-flying, the Peregrine Falcon hunts medium-sized birds, dropping down on them from high above in a spectacular stoop.', '2018-09-24 04:21:30', NULL),
(33, 4, 'Fong Kah Minh', 'hmasad08@gmail.com', 'These are special birds. Gyrfalcon, photo by Clare Kines. They\'re found on six of the seven continents – in fact one species, the cosmopolitan Peregrine Falcon', '2018-09-24 04:26:00', NULL),
(34, 18, 'Asadzaman', 'hmasad08@gmail.com', 'One of the world\'s fastest birds; in power-diving from great heights to strike prey, the Peregrine may possibly reach 200 miles per hour. ', '2018-09-24 04:33:27', NULL),
(35, 18, 'Asadzaman', 'hmasad08@gmail.com', 'Falcons are birds of prey in the genus Falco, which includes about 40 species. Falcons are widely distributed on all continents of the world except Antarctica, though closely related raptors did occur there in the Eocene. Wikipedia\r\nFamily: Falconidae', '2018-09-24 04:39:50', NULL),
(37, 1, 'Asadzaman', 'hmasad08@gmail.com', 'Default value: none currentcolor solid. Inherited: no. Animatable: no, see individual properties. Read about animatable. Version: CSS1, renewed in CSS3.', '2018-09-24 17:57:54', NULL),
(38, 8, 'Asadzaman', 'hmasad08@gmail.com', 'Bootstrap\'s form controls expand on our Rebooted form styles with classes. Use these classes to opt into their customized displays for a more consistent ', '2018-09-25 01:37:43', NULL),
(39, 8, 'Asadzaman Asad', 'ucummerata@example.net', 'Single navbar example of a static top navbar along with some additional content.', '2018-09-25 01:38:26', NULL),
(40, 4, 'Admin', 'ucummerata@example.net', 'Most text editors like MS Word or Lotus Notes generate random lorem text when needed, either as pre-installed module or plug-in to be added.', '2018-09-25 02:13:30', NULL),
(41, 17, 'Zlatan Ibrahimovic', 'hmasad08@gmail.com', 'ESPNcricinfo is a sports news website exclusively for the game of cricket. The site features news, articles, live coverage of cricket matches, and StatsGuru, a database of historical matches and players from the 18th century to the present.', '2018-09-25 23:31:32', NULL),
(43, 23, 'H M Asad-uz-zaman', 'hmasad08@gmail.com', 'The continually changing Fortnite map looks to receive another update soon as a castle was spotted in the background of a new video.Spotted: Castle Donington. 1.6K likes. Something to say or something to celebrate? Advertise your events etc. ', '2018-09-26 13:39:29', NULL),
(44, 7, 'H M Asad(1)', 'hmasad08@gmail.com', 'Phalcon is feature rich, loosely coupled, optimized for high performance full stack framework for PHP.', '2018-09-27 01:33:25', NULL),
(45, 17, 'Robin Hood', 'robinhood@gmail.com', 'In a JQuery event handler, return false both stops the propagation of the event in its tracks and prevents the default behavior the browser would have applied. In a regular inline event handler, it just stops the default behavior. ', '2018-09-28 17:18:38', NULL),
(46, 2, 'Robin Hood', 'robinhood@gmail.com', 'To resolve this issue, it\'s probably easiest to put all the logic in one place—either JQuery or in the inline event, or have the inline event call a function where you perform all of the logic.', '2018-09-28 17:20:07', NULL),
(47, 78, 'H M Asad-uz-zaman', 'hmasad09@gmail.com', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, c', '2018-09-30 02:45:20', NULL),
(48, 70, 'H M Asad-uz-zaman', 'hmasad09@gmail.com', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. ', '2018-09-30 02:45:39', NULL),
(49, 198, 'H M Asad-uz-zaman', 'hmasad09@gmail.com', 'Real people test if your product works properly and assess the usability under real conditions on their own devices.', '2018-10-01 04:14:08', NULL);
